import React from "react";
import "./style.css";
import WavySvg from "../Waves";

function Services() {
  return (
    <div className="container-fluid services pt-5 pb-5">
        <div className="row">
          <div className="col-md-12">
            <h1 className="text-center mt-3">Services
              <span><WavySvg/></span>
            </h1>
            <p className="text-justify">/* Style for "Donec aliq" */
width: 1026px;
height: 39px;
color: #cfcfcf;
font-family: "Crimson Text - Roman";
font-size: 14px;
font-weight: 400;
font-style: normal;
letter-spacing: normal;
line-height: 25px;
text-align: center;
/* Text style for "D, onec al" */
font-style: normal;
letter-spacing: 1.4px;
line-height: normal;</p>
          </div>
        </div>
        <div className="row"></div>
    </div>
  );
}

export default Services;
